                      if(j==1 .and. i==1) then
                         lg_calc=lg_save
                      else
                         call f(neqn, r, lpre,  lg_calc)
                         myfeval = myfeval + 1
                      end if
                      lcurrent=lpre+pas*al1*lg_calc
                      lsumm=lsumm+b(start+2+(i-1)*stage_intern)*lcurrent
                      r=x0n+(1+stage_intern*stage_intern*(i-1))*pas*al1
                      do k=2,stage_intern
                         call f(neqn, r, lcurrent,  lg_calc)
                         myfeval = myfeval + 1
                         lpost=2.0d0*lcurrent-lpre+2.0d0*pas*al1*lg_calc
                         lsumm=lsumm+b(start+1+k+(i-1)*stage_intern)*
     *                        lpost
                         r=x0n+al1*(k*k+
     *                        stage_intern*stage_intern*(i-1))*pas
                         lpre=lcurrent
                         lcurrent=lpost
                      end do
                      lpre=lcurrent
                   end do
                   !!! new, if stage is odd
                   if (mod(stage,stage_intern)==1) then
                      call f(neqn, r, lpre,  lg_calc)
                      myfeval = myfeval + 1
                      lcurrent=lpre+pas*al1*lg_calc
                      lsumm=lsumm+b(start+stage+1)*lcurrent
                   end if
                   
                   y(:,i1)=lsumm
                   ly0n=lsumm
                   lsumm=0.0d0
                   
                   x0n=x0n+pas
                end do 
              end do
              deallocate(lsumm)
              deallocate(lpre)
              deallocate(lpost)
              deallocate(lcurrent)
              deallocate(lg_calc)
              deallocate(lg_save)
              deallocate(ly0n)
!$OMP SECTION
              allocate(lsumm(neqn))
              allocate(lpre(neqn))
              allocate(lpost(neqn))
              allocate(lcurrent(neqn))
              allocate(lg_calc(neqn))
              allocate(lg_save(neqn))
              allocate(ly0n(neqn))
              lsumm=0.0d0
