c     &              ((err_old/tol)**0.2d0)
                fac = 0.8d0*(1.0d0/err)**0.2d0   !!! new
                if (t < tfail) then
                   sec = 1
                else
                   sec = 0
                end if
                
                if((rej_counter < 2) .and. sec == 1) then
                   rej_counter = rej_counter + 1
                   fac = min(1.0d0,fac)
                else if((rej_counter < 5) .and. (sec == 1)) then
                   rej_counter = rej_counter + 1
                   fac = min(2.5d0,fac)
                else
                   fac = min(10.0d0,fac)
                end if
                fac = max(fac,0.1d0)
                dt = dt*fac
                dt = min(dtmax, dt)
             end if
